import React from 'react'

function Table({states}) {
    return (
        <div className="table">
          {
              states.map(state=>{
            <tr>
                <td>{state.state}</td>
              <td><strong>{state.confirmed}</strong></td>
            </tr>
              })
          }

        </div>
    )
}

export default Table
